; Nogueira 2011 , 2012 ).

Description. Umbrella hemispherical, 0.25–17.5 mm in diameter, thin mesoglea with apical thickening. Small stomach, gastric peduncle of variable length, depending on the degree of ontogenetic development. In mature individuals, peduncle can reach 1–3 times the umbrellar height (
Fig. 34
). Mouth with 4 simple or slightly crenulated lips. 4 flattened, circular to leaf-shaped gonads on the radial canals, covering almost the entire subumbrellar surface (
Fig. 34
). 4 long and hollow perradial marginal tentacles, with nematocyst rings. 4 short solid interradial marginal tentacles, with adaxial batteries of nematocysts, which may be lost as the medusa grows. 8 statocysts at the base of the tentacles, with concretions. Young medusae (< 2 mm ) without peduncle, and with only interradial tentacles (
Fig. 35
).

Systematic remarks. Other species have been described for the genus; however, it is currently considered monospecific (
Schuchert 2013
).
Collins et al. ( 2008 )
suggested the existence of cryptic species based on significant divergences in mitochondrial 16 S and nuclear SSU sequence data. The species is easily recognized in all its stages of development due to the general shape, type and arrangement of tentacles, manubrium and peduncle shape, and long gastric peduncle in adults. Its morphology can be highly variable with respect to the shape of the gonads (
Russell 1953
), number of radial (
Zamponi & Genzano 1989 a
, b ) and centripetal canals (
Pagès et al. 1992
), and size (
Bouillon 1999
).

Biological data. In some regions the species occurs in oceanic waters, as in the Benguela Current (Buecher & Gibbons 2001 ), Humboldt Current, Chile (
Kramp 1966
;
Palma et al. 2007
) and off the California coast, USA (Suárez-Morales et al. 2002 ). However, in the Western Atlantic it is generally considered a euryhaline-coastal species (
Larson 1982
; Suárez-Morales et al. 1999 ;
Tronolone 2007
; Mianzan et al. 2000 ). In most studies of planktonic cnidarians in the western tropical and subtropical Atlantic, the species is dominant in coastal waters, and may occur in almost 100 % of the samples (
Vannucci 1963
;
Larson 1982
; Suárez-Morales et al. 1999, 2002;
Tronolone 2007
; present study). In Brazil , densities up to 1000 org.m - 3 were recorded off estuarine regions of Paranaguá (Paraná) and São Francisco do Sul (Santa Catarina) (
Tronolone 2007
). On beaches of southern Uruguay and northern Argentina , aggregations reaching densities of 4.7 * 10 6 org.m - 3 cause skin irritations in bathers (Mianzan et al. 2000 ). Its diet has not been studied in detail, but the species may be an important predator at different trophic levels, given the great diversity of planktonic organisms found within the manubrium, such as herbivorous crustaceans, chaetognaths, and fish eggs and larvae (
Larson 1982
).
